import { Box } from "@mui/system";
import React, { Component } from "react";
import { Button } from "react-bootstrap";
import { Navigate, Route, useNavigate } from "react-router-dom";
import Tutorial1 from "../tutoriale/tutorial1/tutorial1";
import ExpandingCards from "../tutoriale/udemy/expanding-cards/expandingCards";
import ProgressSteps from "../tutoriale/udemy/progress-steps/progress-steps";
import "./dashboard.css";

export default function Dashboard() {
  let navigate = useNavigate();

  function navigateTo(path) {
    navigate(path);
  }

  return (
    <div className="dashboardBody">
      <div className="dashboardDiv">
        {/* <NavBar />*/}
        {/* <ExpandingCards /> */}
        {/* <ProgressSteps /> */}
        <Button
          className="boxClass"
          onClick={() => navigateTo("/expanding-cards")}
        >
          <div className="boxContent">Expanding cards</div>
        </Button>
        <Button
          className="boxClass"
          onClick={() => navigateTo("/progress-steps")}
        >
          Progress steps
        </Button>
      </div>
    </div>
  );
}
